import AccordionItem from './AccordionItem';
import { accordionData } from './AccordionContent';

const Accordion = () => {

  return (
    <div>
      <div className="accordion">
        {accordionData.map(({ title, content }) => (
          <Accordion title={title} content={content} />
        ))}
      </div>
    </div>
  );
};

export default Accordion;
